ce.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:32:"http://www.geekeries.fr/mailjet/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:42:"Qui se cache derrière les organisateurs ?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/dCY2QqlXHzc/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:86:"https://2017.bordeaux.wordcamp.org/2017/03/03/qui-se-cache-derriere-les-organisateurs/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 03 Mar 2017 14:28:43 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:421:"\n		        Dans les coulisses du WordCamp Bordeaux s’active une team très motivée et heureuse de vous concocter un évènement qui s’annonce vraiment exceptionnel. Tous bénévoles, nous avons rapidement proposé notre participation il y a quelques mois déjà, lorsque l’évènement a été présenté. Qui fait quoi ? Où aura lieu l’after ? Le choix des conférences, les réflexions à [&#8230;]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"WordCamp Bordeaux";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1951:"<p>Dans les coulisses du <strong>WordCamp Bordeaux</strong> s’active une <strong>team</strong> très motivée et heureuse de vous concocter un évènement qui s’annonce vraiment exceptionnel.</p>\n<p>Tous bénévoles, nous avons rapidement proposé notre participation il y a quelques mois déjà, lorsque l’évènement a été présenté. Qui fait quoi ? Où aura lieu l’after ? Le choix des conférences, les réflexions à mener autour de l’optimisation des salles, des flux, du déjeuner&#8230;</p>\n<p>Organiser le recrutement des bénévoles [que nous saluons et remercions] qui s’activeront pour rendre l’évènement mémorable.</p>\n<p>Éditer kakemonos et badges. Ne pas oublier Wapuu !</p>\n<p><img class="wp-image-2312 alignleft" src="https://i0.wp.com/2017.bordeaux.wordcamp.org/files/2017/02/Wapuu_auguste_wcbdx.png?resize=144%2C148" alt="Auguste Wapuu WordCamp Bordeaux" /></p>\n<p>Une liste, des tableaux, des cases, des e-mails, des échanges hebdomadaires&#8230;</p>\n<p><strong>Skype, Google Drive, Trello et Slack</strong> sont vite devenus nos meilleurs amis, car nous vivons dans des contrées parfois un peu éloignées, exception faite de notre précieuse Mylène, qui vit à Bordeaux.</p>\n<p>Il reste encore plein de choses à préparer et l’effervescence monte, car nous avons à cœur que vous passiez de riches moments.</p>\n<p>En attendant, nous souhaitions venir à votre rencontre et vous pouvez consulter nos <strong>profils</strong> sur la <a href="https://2017.bordeaux.wordcamp.org/organisateurs/">page dédiée</a>.</p>\n<p>On a tous hâte de vous retrouver dans quinze jours à présent ! À très bientôt !</p>\n<p><a class="cta long" href="https://2017.bordeaux.wordcamp.org/billets"><span class="dashicons-before dashicons-tickets">Pas encore de billet ?</span><span>C&rsquo;est parti ! »</span></a></p><img src="http://feeds.feedburner.com/~r/wpfr/~4/dCY2QqlXHzc" height="1" width="1" alt=""/