(1, 1, '2017-03-06 10:17:31', '2017-03-06 09:17:31', 'Bienvenue dans WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis lancez-vous !', 'Article 1', '', 'publish', 'open', 'open', '', 'bonjour-tout-le-monde', '', '', '2017-03-06 11:12:35', '2017-03-06 10:12:35', '', 0, 'http://localhost:8888/controle-6-mars-lbeuchot/?p=1', 0, 'post', '', 1),
(2, 1, '2017-03-06 10:17:31', '2017-03-06 09:17:31', 'Voici un exemple de page. Elle est différente d’un article de blog, en cela qu’elle restera à la même place, et s’affichera dans le menu de navigation de votre site (en fonction de votre thème). La plupart des gens commencent par écrire une page « À Propos » qui les présente aux visiteurs potentiels du site. Vous pourriez y écrire quelque chose de ce tenant :\r\n<blockquote>Bonjour ! Je suis un mécanicien qui aspire à devenir un acteur, et voici mon blog. J’habite à Bordeaux, j’ai un super chien baptisé Russell, et j’aime la vodka-ananas (ainsi que regarder la pluie tomber).</blockquote>\r\n...ou bien quelque chose comme ça :\r\n<blockquote>La société 123 Machin Truc a été créée en 1971, et n’a cessé de proposer au public des machins-trucs de qualité depuis lors. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</blockquote>\r\nÉtant donné que vous êtes un nouvel utilisateur de WordPress, vous devriez vous rendre sur votre <a href="http://localhost:8888/controle-6-mars-lbeuchot/wp-admin/">Tableau de bord</a> pour effacer la présente page, et créer de nouvelles pages avec votre propre contenu. Amusez-vous bien !', 'Activity', '', 'publish', 'closed', 'open', '', 'page-d-exemple', '', '', '2017-03-06 11:18:20', '2017-03-06 10:18:20', '', 0, 'http://localhost:8888/controle-6-mars-lbeuchot/?page_id=2', 0, 'page', '', 0),
